const city = sessionStorage.getItem('selectedcity');
const lat = sessionStorage.getItem('latitude');
const lng = sessionStorage.getItem('longitude');
// Global variables for each weather parameter
let weatherDescription;
let temperature;
let feelsLike;
let minTemperature;
let maxTemperature;
let humidity;
let pressure;
let windSpeed;
let windDirection;
let cloudiness;
let visibility;
let sunrise;
let sunset;


document.addEventListener('DOMContentLoaded', function () {
    // Retrieve the city from sessionStorage
    if (city) {
        // Display the city name or full address in the div
        document.getElementById('city_name').innerHTML = `Address: ${city}`;
    
        // Call the function to fetch weather details
        fetch_weatherdetailsByCoordinates(lat, lng);
        fetchforecastDetails(lat, lng);
    
    } else {
        document.getElementById('city_name').textContent = 'No city found!';
    }
});

function fetch_weatherdetailsByCoordinates(lat, lng) {
    const apiKey = '4cac586c12422d59f72b1e4df224bbb4'; 
    const url = `https://api.openweathermap.org/data/2.5/weather?lat=${lat}&lon=${lng}&appid=${apiKey}&units=metric`;
     
    fetch(url)
        .then(response => {
            if (!response.ok) {
                throw new Error('Failed to fetch weather details');
            }
            return response.json();
        })
        .then(data => {
            // Extract and display weather details
            const weatherDetails = `
                <p id="weather"><strong>Weather:</strong> ${data.weather[0].main} (${data.weather[0].description})</p>
                <p id="temperature"><strong>Temperature:</strong> ${data.main.temp}°C</p>
                <p id="feels-like"><strong>Feels Like:</strong> ${data.main.feels_like}°C</p>
                <p id="temp-min"><strong>Min Temperature:</strong> ${data.main.temp_min}°C</p>
                <p id="temp-max"><strong>Max Temperature:</strong> ${data.main.temp_max}°C</p>
                <p id="humidity"><strong>Humidity:</strong> ${data.main.humidity}%</p>
                <p id="pressure"><strong>Pressure:</strong> ${data.main.pressure} hPa</p>
                <p id="wind-speed"><strong>Wind Speed:</strong> ${data.wind.speed} m/s</p>
                <p id="wind-direction"><strong>Wind Direction:</strong> ${data.wind.deg}°</p>
                <p id="cloudiness"><strong>Cloudiness:</strong> ${data.clouds.all}%</p>
                <p id="visibility"><strong>Visibility:</strong> ${data.visibility} meters</p>
                <p id="sunrise"><strong>Sunrise:</strong> ${new Date(data.sys.sunrise * 1000).toLocaleTimeString()}</p>
                <p id="sunset"><strong>Sunset:</strong> ${new Date(data.sys.sunset * 1000).toLocaleTimeString()}</p>
            `;
            
            // Display the weather details in the DOM
            document.getElementById('weather-info').innerHTML = weatherDetails;
            displayWeatherDetails(data);
            
            // After displaying weather details, call setBackgrounds
            setBackgrounds();
        })
        .catch(error => {
            console.error('Error:', error);
            document.getElementById('weather-info').textContent = 'Unable to fetch weather details.';
        });
}

function displayWeatherDetails(data) {
    // Assign values from the API response to the global variables
    weatherDescription = data.weather[0].description;
    temperature = data.main.temp;
    feelsLike = data.main.feels_like;
    minTemperature = data.main.temp_min;
    maxTemperature = data.main.temp_max;
    humidity = data.main.humidity;
    pressure = data.main.pressure;
    windSpeed = data.wind.speed;
    windDirection = data.wind.deg;
    cloudiness = data.clouds.all;
    visibility = data.visibility;
    sunrise = new Date(data.sys.sunrise * 1000).toLocaleTimeString();
    sunset = new Date(data.sys.sunset * 1000).toLocaleTimeString();

    console.log(weatherDescription, temperature, feelsLike, minTemperature, maxTemperature, humidity, pressure, windSpeed, windDirection, cloudiness, visibility, sunrise, sunset);
    
    // Now you can use these global variables elsewhere in your code
    // Run the function to set backgrounds after variables are assigned
}

document.addEventListener('DOMContentLoaded', function () {
    let currentDate = new Date();
    currentDate.setDate(currentDate.getDate() + 1); // Default date is current date + 1

    function updateDateDisplay() {
        document.getElementById('selected-date').textContent = currentDate.toDateString();
        fetchForecastDetailsForDate(currentDate);
    }
    function fetchForecastDetailsForDate(date) {
        // Convert date to the format that matches the API response and adjust based on hours
        const selectedDate = date.toISOString().split('T')[0]; // Get only the date part
        fetchforecastDetails(lat, lng, selectedDate);
    }

    document.getElementById('forward-btn').addEventListener('click', function () {
        currentDate.setDate(currentDate.getDate() + 1);
        updateDateDisplay();
    });

    document.getElementById('backward-btn').addEventListener('click', function () {
        currentDate.setDate(currentDate.getDate() - 1);
        updateDateDisplay();
    });

    // Initial display
    updateDateDisplay(); 
});
function fetchforecastDetails(latitude, longitude, selectedDate) {
    const apiKey = '4cac586c12422d59f72b1e4df224bbb4'; // Replace with your OpenWeatherMap API key
    const forecastUrl = `https://api.openweathermap.org/data/2.5/forecast?lat=${latitude}&lon=${longitude}&units=metric&appid=${apiKey}`;

    fetch(forecastUrl)
        .then(response => response.json())
        .then(data => {
            displayForecastForDate(data, selectedDate);
        })
        .catch(error => {
            console.error('Error fetching weather data:', error);
        });
        
}

function displayForecastForDate(data, selectedDate) {
    const forecastContainer = document.getElementById('forecast-details');
    forecastContainer.innerHTML = '';

    data.list.forEach(entry => {
        const dateTime = new Date(entry.dt * 1000);
        const date = dateTime.toISOString().split('T')[0];

        if (date === selectedDate) {
            const weather = entry.weather[0].description;
            const temp = entry.main.temp;
            const humidity = entry.main.humidity;
            const windSpeed = entry.wind.speed;

            forecastContainer.innerHTML += `
                <div>
                    <h4>${dateTime.toLocaleString()}</h4>
                    <p>Weather: ${weather}</p>
                    <p>Temperature: ${temp}°C</p>
                    <p>Humidity: ${humidity}%</p>
                    <p>Wind Speed: ${windSpeed} m/s</p>
                </div>
                <hr>
            `;
        }
    });
}
